import React from 'react'
import styles from './NotFound404.module.css'

const NotFound404 = () => {
  return (
    <div className={styles.contentContainer}>
      <span className={styles.text_404}>404</span>

      <h1 className={styles.title}>
        Not Found
      </h1>


    </div>
  )
}

export default NotFound404
